import { SET_CURRENT_PROFILE_TAB } from './types';
export const setProfileTab = (tab) => (dispatch) => {
    dispatch({ type: SET_CURRENT_PROFILE_TAB, payload: tab });
};
export const setCompanyTab = (tab) => (dispatch) => {
    dispatch({ type: SET_CURRENT_PROFILE_TAB, payload: tab });
};
